// ==UserScript==
// @name Görev Verici Gösterici
// @namespace Oguzhan Cekic
// @author neaL* (Güncelleyen bay OguzhanCekic)
// @description Harita üzerinde NPC'lerin yerini gösterir!
// @include https://*.the-west.*/game.php*
// @version 1.5
// @grant none
// ==/UserScript==
// translation:OguzhanC [Türkçe]
(function (fn) {
  var script = document.createElement('script');
  script.setAttribute('type', 'application/javascript');
  script.textContent = '(' + fn + ')();';
  document.body.appendChild(script);
  document.body.removeChild(script);
}) (function () {
  npcLocator = {
    version: '1.0',
    name: 'Görev Verici Görüntüleyici',
    author: 'neaL* (updated by Oquzhan*)',
    minGame: '1.0',
    maxGame: Game.version.toString(),
    website: '#',
    updateUrl: '#',
    updateAd: '#',
    loading: false,
    inner: '',
    langs: {
      tr: {
        language: '(Türkçe)',
        ApiGui: 'Bu komut minimap NPC konumunu gösterir.<br>Yine tıklayarak, macera verici haritanın merkezine alabilirsiniz.',
        contact: 'Bana ulaşmak isterseniz ',
        loading: 'Geçerli görev vericiler Yükleniyor',
        title: 'Görev verici haritası',
        chooseNpc: 'İşverenin seçimi',
        yourposition: 'Bulunduğunuz yer',
        questgiver: 'Görevin bulunduğu yer',
        reload: 'Tüm görev vericileri güncelle',
        update: 'Güncelleştir',
        updateAvailable: 'Scriptin yeni bir sürümü',
      },
    },
    images: {
      map: 'data:image/jpeg;base64,',
        reload: 'data:image/png;base64,',
        menu: 'data:image/png;base64,',
    },
  };
  MMlang = npcLocator.langs.hasOwnProperty(Game.locale.substr(0, 2)) ? npcLocator.langs[Game.locale.substr(0, 2)] : npcLocator.langs.tr;
  var fmfb = function (l) {
    return 'https://forum.the-west.' + l + '/index.php?conversations/add&to=Tom Robert';
  },
  npcLocatorApi = TheWestApi.register('npcLocator', npcLocator.name, npcLocator.minGame, npcLocator.maxGame, npcLocator.author, npcLocator.website);
  npcLocatorApi.setGui('<br><i>Language detected: </i>' + MMlang.language + '<br><br>' + MMlang.ApiGui + '<br><br><i>' + npcLocator.name + ' v' + npcLocator.version +
  '</i><br><br><br><b>' + MMlang.contact + ':</b><ul style="margin-left:15px;"><li>İletişim<a target=\'_blanck\' href="https://www.facebook.com/duzceli.oguzhan">Facebook</a></li>' +
  '<a target=\'_blanck\' href="#"><img src="../images/chat/emoticons/smile.png"></li></ul>');
  npcLocator.init = function () {
    var style = document.createElement('style');
    var css = '#njk_minimap_map {position:relative;display:block;float:left;width:498px;height:219px;background-repeat:no-repeat;background-image:url("' + npcLocator.images.map + '"); margin-left: 5px;}' +
    '#njk_minimap_map span.adv_pointer {position:absolute;display:block;height:16px;width:16px;cursor:pointer;background: 0 0 no-repeat transparent url("../images/map/minimap/icons/miniicon_quests.png");}' +
    '#njk_minimap_map span.char_pointer {position:absolute;display:block;height:16px;width:16px;cursor:pointer;background: 0 0 no-repeat transparent url("../images/map/minimap/icons/miniicon_pos.png");}' +
    '#njk_minimap #npcLocator_helpers {float:left;height:20px;width:150px;padding-left:5px;text-align:left;color:black;}' +
    '#njk_minimap span.advHelper {display:block;text-indent:20px;height:16px;line-height:16px; background: 0 0 no-repeat transparent url("../images/map/minimap/icons/miniicon_quests.png");}' +
    '#njk_minimap span.charHelper {display:block;text-indent:20px;height:16px;line-height:16px; background: 0 0 no-repeat transparent url("../images/map/minimap/icons/miniicon_pos.png");}' +
    '#njk_minimap #npcLocator_reload {margin:-7px 3px 0 0;cursor:pointer;}';
    style.setAttribute('type', 'text/css');
    if (style.styleSheet) {
      style.styleSheet.cssText = css;
    } else {
      style.appendChild(document.createTextNode(css));
    }
    document.getElementsByTagName('head') [0].appendChild(style);
    npcLocator.start();
  };
  npcLocator.start = function () {
    if (window.document.getElementById('ui_menubar')) {
      try {
        this.addButton();
      } catch (e) {
      }
    } else {
      setTimeout(function () {
        npcLocator.start();
      }, 1000);
    }
  };
  npcLocator.addButton = function () {
    var t = $('<div title="' + npcLocator.name + '" class="menulink" />').css('background-image', 'url(' + npcLocator.images.menu + ')').css('background-position', '0px 0px').mouseenter(function () {
      $(this).css('background-position', '-25px 0px');
    }).mouseleave(function () {
      $(this).css('background-position', '0px 0px');
    }).click(function () {
      if (!npcLocator.employers)
      npcLocator.load();
       else if (npcLocator.loading === false)
      npcLocator.open();
    });
    $('#ui_menubar').append($('<div class="ui_menucontainer" />').append(t).append('<div class="menucontainer_bottom" />'));
  };
  npcLocator.load = function () {
    if (npcLocator.loading === false) {
      npcLocator.loading = true;
      new UserMessage(MMlang.loading, 'hint').show();
      Ajax.get('map', 'get_minimap', {
      }, function (json) {
        if (json.error) return new UserMessage(json.msg).show();
        var locs = [
        ];
        for (var loc in json.quest_locations)
        locs.push([parseInt(json.quest_locations[loc][0][0] / Map.tileSize),
        parseInt(json.quest_locations[loc][0][1] / Map.tileSize)]);
        Ajax.get('map', 'get_complete_data', {
          tiles: JSON.stringify(locs)
        }).done(function (res) {
          var ne = npcLocator.employers = {
          };
          var rq = res.quests;
          for (var g = 0; g < locs.length; g++) {
            var em = rq[locs[g][0]][locs[g][1]][0][1];
            for (var h = 0; h < em.employer.length; h++)
            if (!ne[em.employer[h].name]) ne[em.employer[h].name] = em.x + ';' + em.y;
             else ne[em.employer[h].name] += '|' + em.x + ';' + em.y;
          }
          var ne2 = Object.keys(ne).sort(function (a, b) {
            a = a.toLowerCase();
            a = a.replace(/ä/g, 'a');
            a = a.replace(/ö/g, 'o');
            a = a.replace(/ł/g, 'l');
            a = a.replace(/ś/g, 's');
            b = b.toLowerCase();
            b = b.replace(/ä/g, 'a');
            b = b.replace(/ö/g, 'o');
            b = b.replace(/ł/g, 'l');
            b = b.replace(/ś/g, 's');
            return (a > b) ? 1 : - 1;
          });
          for (var j = 0; j < ne2.length; j++)
          npcLocator.inner += '<option value="' + ne[ne2[j]] + '">' + ne2[j] + '</option>';
          npcLocator.open();
          npcLocator.loading = false;
        });
      });
    }
  };
  npcLocator.open = function () {
    var mm = wman.open('npc_minimap', null).setMiniTitle(npcLocator.name).setTitle(MMlang.title);
    $('.npc_minimap').css('width', '560px').css('height', '352px');
    var mm_mapdiv = $('<div id="njk_minimap_map" />'),
    CharX = Character.position.x,
    CharY = Character.position.y,
    x = 685 * CharX / 182 / 256 - 6,
    y = 302 * CharY / 80 / 256 - 6;
    x = x * 0.727;
    y = y * 0.727;
    npcLocator.charPoint = '<span title="' + MMlang.yourposition + '" class="char_pointer" onClick="Map.center(' + CharX + ',' + CharY + ')" style="left:' + x + 'px; top:' + y + 'px;">';
    mm_mapdiv.append(npcLocator.charPoint);
    mm.appendToContentPane($('<div id="njk_minimap"/>').append(mm_mapdiv));
    npcLocator.drawSelect();
  };
  npcLocator.drawSelect = function () {
    var selectDiv = window.document.createElement('div');
    selectDiv.style.cssText = 'color: #fff; font-size: 11px;';
    selectDiv.style.height = '38px';
    selectDiv.style.marginTop = '0px';
    selectDiv.style.marginRight = '5px';
    selectDiv.style.textAlign = 'right';
    selectDiv.innerHTML = '<img src="' + npcLocator.images.reload + '" onclick="npcLocator.load()" id="npcLocator_reload" title="' + MMlang.reload + '"><select style="background-color: #e8dab3; font-size: 14px; width: 200px; cursor:pointer;" onchange="npcLocator.questPoint(this);" id="npcLocator_dropdown" size="1">' +
    '<option selected disabled>-' + MMlang.chooseNpc + '</option>' + npcLocator.inner +
    '</select><div id="npcLocator_helpers"><span class="charHelper">' + MMlang.yourposition + '</span><span class="advHelper">' + MMlang.questgiver + '</span></div>';
    var mm2 = document.getElementById('njk_minimap');
    mm2.insertBefore(selectDiv, mm2.firstChild);
  };
  npcLocator.questPoint = function (place) {
    var dp = $('#njk_minimap_map');
    dp.find('.adv_pointer').remove();
    var positions = place.value;
    var arrPos = positions.split('|');
    for (var i = 0; i < arrPos.length; i++) {
      var xy = arrPos[i].split(';'),
      x = 685 * xy[0] / 182 / 256 - 6,
      y = 302 * xy[1] / 80 / 256 - 6;
      x = x * 0.727;
      y = y * 0.727;
      dp.append('<span class="adv_pointer" onClick="Map.center(' + xy[0] + ',' + xy[1] + ')" id="mapPos' + i + '" px="' + xy[0] + '" py="' + xy[1] + '" style="left:' + x + 'px; top:' + y + 'px;">');
    }
  };
  npcLocator.Updater = function () {
    $.getScript(npcLocator.updateUrl, function () {
      if (scriptUpdate.npcLocator > npcLocator.version) {
        var updateMessage = new west.gui.Dialog(MMlang.update + ': ' + npcLocator.name, '<span>' + MMlang.updateAvailable + '<br><br><b>v' + scriptUpdate.npcLocator + ':</b><br>' + scriptUpdate.npcLocatorNew + '</span>', west.gui.Dialog.SYS_WARNING).addButton(MMlang.update, function () {
          updateMessage.hide();
          window.open(npcLocator.updateAd);
        }).addButton(MMlang.update + ' [NoAds]', function () {
          updateMessage.hide();
          location.href = npcLocator.website + '/code.user.js';
        }).addButton('cancel').show();
      }
    });
  };
  setTimeout(npcLocator.Updater, 7000);
  npcLocator.init();
});
